INSERT INTO lessons_lexicalexercise VALUES(107,replace(replace('A: 请问，到埃及的信要多少天？\r\nB: 你寄平信还是寄航空信？\r\nA: 航空信。\r\nB: 要一个星期。\r\nA: 我要挂号。\r\n…\r\nB: 这是挂号收据，请收好。','\r',chr(13)),'\n',chr(10)),'audio/L34_3Lexical_exercises2_part_1.mp3',6,106);
INSERT INTO lessons_lexicalexercise VALUES(108,replace(replace('A: 我要寄一个包裹。\r\nB: 里边装着什么？\r\nA: 一顶帽子和两条裤子。\r\nB: 这是包裹单，您到那儿坐着写吧。\r\nA: 好。','\r',chr(13)),'\n',chr(10)),'audio/L34_3Lexical_exercises2_part_2.mp3',6,106);
INSERT INTO lessons_lexicalexercise VALUES(109,replace(replace('A: 请问，打国际电报在几号窗口？\r\nB: 在五号窗口。\r\nA: 先生，请给我一张电报纸。谢谢。可以打英文电报吗？\r\nC: 可以，写得清楚点儿。\r\nA: 您看，这样可以吗？\r\nC: 下边还要写您的姓名和地址。\r\nA: 啊，我忘了。','\r',chr(13)),'\n',chr(10)),'audio/L34_3Lexical_exercises2_part_3.mp3',6,106);
INSERT INTO lessons_lexicalexercise VALUES(110,replace(replace('顾客: 我要寄两封信。\r\n工作人员: 寄航空信，还是寄平信？\r\n顾客: 寄航空信。\r\n工作人员: 一毛一封，两封两毛。\r\n顾客: 有纪念邮票吗？\r\n工作人员: 有，你要这种还是要那种？\r\n顾客: 要那种，要两套。多少钱？\r\n工作人员: 一块两块五毛一。\r\n顾客: 多少？两块五毛一，还是两块五毛七？\r\n工作人员: 两块五毛一。还要别的吗？\r\n顾客: 我还要信封和信纸。\r\n工作人员: 我们卖信封，不卖信纸。\r\n顾客: 好，我买信封。一套信封是十个还是十二个？\r\n工作人员: 十个。\r\n顾客: 请问，信箱在哪儿？在里边儿还是在外边儿？\r\n工作人员: 在里边儿。\r\n顾客: 谢谢。\r\n工作人员: 不谢。','\r',chr(13)),'\n',chr(10)),'audio/L34_3Lexical_exercises2_part_4.mp3',6,NULL);
INSERT INTO lessons_lexicalexercise VALUES(111,replace(replace('到达这个国家\r\n\r\n到中国已经一个月了。\r\n从我们首都来北京的时候，我坐飞机坐了七个小时。\r\n到了学校，没有立刻上课，先休息了三天。\r\n我们到北京的公园玩了玩。\r\n这是我在北京照的照片，寄给你几张。','\r',chr(13)),'\n',chr(10)),'audio/L34_3Lexical_exercises2_part_5.mp3',6,110);
INSERT INTO lessons_readingtext VALUES(2,replace(replace('你最近透视过没有？\r\n安德烈：小张，医务所在哪儿？\r\n张华光：你去看病吗？\r\n安德烈：不，我去检查身体。我还没去过医务所。\r\n张华光：跟我走吧。来北京一个多星期了，你们去过哪些地方了？\r\n安德烈：去过长城和北海。\r\n张华光：看过中国电影吗？\r\n安德烈：在电视里看过几次电影。\r\n张华光：今夭晚上学校有电影，你去吗？\r\n安德烈：什么电影？\r\n张华光：《大闹天宫》。这个电影真不错，我已经看过两遍了。\r\n安德烈：还想看第三遍吗？今天晚上我们一起去吧。\r\n张华光：好。医务所到了，你在那儿拿一张表，先到内科检查。','\r',chr(13)),'\n',chr(10)),'audio/L32_1_Text_1part.mp3',1);
INSERT INTO lessons_readingtext VALUES(3,replace(replace('安德烈：大夫您好！\r\n大夫：你好，请坐。你第一次来中国吗？\r\n安德烈：是啊。也是第一次来医务所。\r\n大夫：你以前得过什么病？\r\n安德烈：没有。—对了，我小时候得过肺炎,病了两个多星期。\r\n大夫：听听心脏，量一下儿血压吧……\r\n安德烈：大夫，我的心脏和血压都正常吗？\r\n大夫：都很正常。你最近透视过没有？\r\n安德烈：去年二月透视过一次。\r\n大夫：时间太长了。请到对面房间透视一下儿吧。\r\n安德烈：透视以后就可以走了吗？\r\n大夫：不，还要检查一下儿眼睛、鼻子和耳朵。\r\n安德烈：我想这些都没问题。\r\n大夫：我也希望这样。\r\n安德烈：谢谢。我听过这样的话：爸爸妈妈给我生命，老师给我知识，大夫给我健康。\r\n大夫：这话很有意思。可是我希望你的健康不是大夫给的，要自己注意锻炼。祝你健康，\r\n再见！','\r',chr(13)),'\n',chr(10)),'audio/L32_1_Text_2part.mp3',1);
INSERT INTO lessons_readingtext VALUES(5,replace(replace('一位留学生的作文：\r\n我是俄罗斯留学生，以前没来过中国，这是第一次。在俄罗斯我学过三年中文，开始的时候，我常常到一家华侨餐厅吃饭，认识了一位华侨朋友，他教我说中国话。我每星期还到中文系听两次课。我的朋友们常帮我，他们非常热情，让我很受了。我现在很喜欢学习中文。在学校里，我认识了一些中国留学生，他们常帮助我，所以我进步很快。学了两年多的中文以后，我开始看中文画报和杂志，了解了一些中国的文化和历史，我更喜欢中文了。我希望以后能研究中国医学。\r\n很早以前我就想到中国看看。现在能在中国学习，我非常高兴。来北京快两个星期了，我又认识了不少中国朋友。我的同屋是个同学，他的个子不太大，身体很好，头发和眼睛都很黑。他已经学了两年的法语了。现在我们常互相帮助，他是我最好的朋友。\r\n学校里每星期有两次中国电影，我已经看过三次了。今天晚上有一个新电影，我同屋说要跟我一起去看。','\r',chr(13)),'\n',chr(10)),'audio/L32_4_Text_for_reading.mp3',1);
INSERT INTO lessons_readingtext VALUES(6,replace(replace('现在下雨了\r\n玛莎：四点多了，李老师不来了吧？\r\n安德烈：听，有人敲门，李老师来了。\r\n李老师：安德烈在吗？\r\n安德烈：在，请进。\r\n李老师：啊，玛莎也在这儿。你们好！\r\n玛莎：您好，请坐。李老师，请您喝杯咖啡吧?\r\n李老师：谢谢。今天天气很好，你们没到公园玩儿玩儿吗？\r\n安德烈：上午去颐和园了。\r\n李老师：香山去过吗？\r\n玛莎：还没去过。那儿怎么样？\r\n李老师：香山的红叶很漂亮，现在是秋天了，树上的叶子都红了，可以看红叶了.\r\n安德烈：我们一定去。以前有人告诉我，北京夏天很热，到北京以后，我觉得不太热。\r\n李老师：这几年天气不正常。你知道吗?北京的秋天天气最好，可是今年秋天也常常下雨。你们看，今天上午是晴天，现在下雨了。\r\n安德烈：北京冬天冷不冷？\r\n李老师：冬天很冷，常常刮风，下雪。\r\n玛莎：在中国冬天有什么花儿？\r\n李老师：很多地方有梅花。在大风大雪的天气，梅花不怕风不怕雪，开得很好，所以大家都喜欢花。从古时候到今天，文学家为梅花写了不少诗。\r\n安德烈：您教我们一首，好吗？\r\n李老师：这样的诗很多。我给你们念一首吧，是陈毅的《红梅》:\r\n隆冬到来时，百花迹已绝。\r\n红梅不屈服，树树立风雪。\r\n玛莎：这首诗真好，请您再介绍一首。\r\n李老师：时间不早了，雨也停了，我们以后再介绍吧。安德烈，这是你要的那本语法书。\r\n安德烈：谢谢您。您再坐坐吧。\r\n李老师：不坐了，我还有点事儿，再见！\r\n玛莎：希望您常来，再见！','\r',chr(13)),'\n',chr(10)),'audio/L33_1_Text_1.mp3',5);
INSERT INTO lessons_readingtext VALUES(7,'现在下雨了：加速录音','audio/L33_1_Text_2.mp3',5);
INSERT INTO lessons_readingtext VALUES(8,replace(replace('北京的天气\r\n北京一年有四个季节:春天、夏天、秋天和冬天。\r\n北京的冬天时间最长。冬天天气很冷，常常刮风，有时候下雪。最冷的时候到过零下二十二度。北京人很喜欢滑冰，冬天在北海滑冰很有意思。第一年玛莎很不习惯，得过一次感冒。\r\n北京的春天很暖和。这时候树绿了，花儿开了，公园里人也多了。春天时间不太长，这儿很少下雨，有时候刮大风。\r\n从六月到八月是北京的夏天，夏天天气不太热。最热的时候是七月，七月、八月常常下雨。夏天的颐和园是大家常去的地方，很多人去那儿游泳、钓鱼。\r\n九月，北京的秋天到了。秋天是北京最好的季节，天天都是晴天，不冷也不热，非常凉快。十一月到了，香山的树叶都红了，大家都喜欢去看红叶。很多外国朋友都在这时候到北京来参观。','\r',chr(13)),'\n',chr(10)),'audio/L33_Text_for_reading_0.mp3',5);
INSERT INTO lessons_readingtext VALUES(9,replace(replace('现在播送中央气象台今天下午六点钟发布的城市天气预报:\r\n北京：小雪，零下6度到零下2度\r\n哈尔滨:雪，零下15度到零下9度\r\n天津：晴转多云，零下2度到（零上)4度\r\n西安:阴有小雨，零下3度到（零上)6度\r\n上海:小雨，北风3到4级,（零上)1度到10度\r\n台北:晴，16度到22度\r\n香港:雨，14度到23度\r\n北京：小雪，零下6度到零下2度。\r\n天气预报播送完了。','\r',chr(13)),'\n',chr(10)),'audio/L33_Text_for_reading_1.mp3',5);
INSERT INTO lessons_readingtext VALUES(10,replace(replace('天气预报播\r\n各位听众，现在播送北京气象台\r\n今天下午五点钟发布的北京天气预报；\r\n今天夜间阴有小雪，风向北，风力二三级。\r\n最低气温零下四度。\r\n明天白天，晴，风向北转南，风力二三级，最高气温三度。\r\n天气预报播送完了。','\r',chr(13)),'\n',chr(10)),'audio/L33_Text_for_reading_2.mp3',5);
INSERT INTO lessons_readingtext VALUES(11,replace(replace('图片上写着:《怎样写信封?》\r\n下了一上午的雨，下午天晴了。\r\n玛莎跟丁云分别的时候，丁云跟她说过:《到北京以后一定要去家里看看》。\r\n今天，她给丁云的妈妈写了一封信，问他们什么时间有空儿,她想去看他们。\r\n安德烈也要给南京的朋友寄一封信，他们一起去邮局。\r\n六点多了，邮局的门还开着呢。邮局里人很多，有的坐着写信,有的等着寄东西。\r\n他们到了一个窗口前边。那儿挂着一个牌子，牌子上写着《邮票、挂号》;\r\n柜台里放着很多漂亮的邮票和明信片。玛莎跟营业员说:《我想买几张明信片》。\r\n营业员热情地回答:《有、这儿有介绍北京的。请看，天安门、北海、颐和园、香山…我想您一定很喜欢》\r\n玛莎笑着说：《对，就要这些。我想让家里人也看看北京》。\r\n安德烈拿着他的信跟营业员说:《我要寄航空挂号信》。\r\n营业员看了看信封说：《寄本市的信没有航空的》。\r\n安德烈大声地说:《不，这不是寄本市的，是寄南京的》。\r\n营业员又看了看安德烈的信封，她笑了;\r\n玛莎一看，也笑了。\r\n她们为什么笑呢？\r\n安德烈的信封，上边写着他自己的地址和姓名，下边写着收信人的地址，姓名。\r\n营业员指着墙上的图片说：《中文信封应该这样写》。\r\n安德烈一看，图片上写着:《怎样写信封?》','\r',chr(13)),'\n',chr(10)),'audio/L34_Text_0.mp3',6);
