INSERT INTO lessons_homework VALUES(17,'homework_images/IMG_8490.jpeg',replace(replace('текст про учебу на факультете, про группу\r\nPinyin:\r\nWǒ zài yìngyòng shùxué xì xuéxí.\r\nWǒmen xuéxí hěnduō yǒuqù de kèchéng.\r\nBǐrú wēijī fēn, tǒngjìxué hé xiànxíng dài shù.\r\nTǒngjìxué bāngzhù wǒmen fēnxī shùjù, dài shù hé wēijī fēn bāngzhù jiějué fāngchéng.\r\nWǒmen hái xuéxí jīqì xuéxí.\r\nBiānchéng yǔyán bāngzhù wǒmen shíxiàn suànfǎ.\r\nZhèxiē zhīshì, wǒ xīwàng jiānglái néng yòng shùxué hé biānchéng jiějué shíjiān wèntí.\r\nZài wǒmen bān lǐ, dàjiā guānxì hěn hǎo.\r\nWǒmen hùxiāng bāngzhù.\r\nZài sùshè lǐ měitiān yīqǐ xuéxí hé tǎolùn shùxué wèntí, yě chángcháng fùxí kǎoshì.\r\nShēnghuó zài sùshè hěn fāngbiàn. Wǒmen hùxiāng zhàogù. \r\nTōngguò zhèyàng, wǒmen bùjǐn tígāo zìjǐ de xuéxí shuǐpíng, hái jiànshè yǒuyì.','\r',chr(13)),'\n',chr(10)),5,'2024-11-15 21:24:13.953479',1);
