CREATE TABLE IF NOT EXISTS "django_content_type" ("id" SERIAL PRIMARY KEY, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" SERIAL PRIMARY KEY, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" SERIAL PRIMARY KEY, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" SERIAL PRIMARY KEY, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "mindmaps_mindmap" ("id" SERIAL PRIMARY KEY, "title" varchar(200) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "mindmaps_wordinmindmap" ("id" SERIAL PRIMARY KEY, "mind_map_id" bigint NOT NULL REFERENCES "mindmaps_mindmap" ("id") DEFERRABLE INITIALLY DEFERRED, "word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED, "parent_id" bigint NULL REFERENCES "mindmaps_wordinmindmap" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "users_deck" ("id" SERIAL PRIMARY KEY, "name" varchar(100) NOT NULL, "creator_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_deckword" ("id" SERIAL PRIMARY KEY, "added_at" datetime NOT NULL, "deck_id" bigint NOT NULL REFERENCES "users_deck" ("id") DEFERRABLE INITIALLY DEFERRED, "word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_userdeck" ("id" SERIAL PRIMARY KEY, "percent" integer NOT NULL, "timestamp" datetime NOT NULL, "edited" datetime NOT NULL, "deck_id" bigint NOT NULL REFERENCES "users_deck" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_wordperformance" ("id" SERIAL PRIMARY KEY, "ef_factor" real NOT NULL, "repetitions" integer NOT NULL, "right" integer NOT NULL, "wrong" integer NOT NULL, "timestamp" datetime NOT NULL, "edited" datetime NOT NULL, "next_review_date" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_deckperformance" ("id" SERIAL PRIMARY KEY, "percent_correct" integer NOT NULL, "test_date" datetime NOT NULL, "deck_id" bigint NOT NULL REFERENCES "users_deck" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "chineseword_chineseword" ("id" SERIAL PRIMARY KEY, "simplified" varchar(50) NOT NULL, "traditional" varchar(50) NULL, "pinyin" varchar(100) NULL, "meaning" text NULL, "hsk_level" varchar(10) NULL, CONSTRAINT "unique_simplified_pinyin_meaning" UNIQUE ("simplified", "pinyin", "meaning"));
CREATE TABLE IF NOT EXISTS "users_deckperformance_wrong_answers" ("id" SERIAL PRIMARY KEY, "deckperformance_id" bigint NOT NULL REFERENCES "users_deckperformance" ("id") DEFERRABLE INITIALLY DEFERRED, "chineseword_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "wordpages_sentence" ("id" SERIAL PRIMARY KEY, "content" text NOT NULL, "chinese_word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED, "meaning" text NULL);
CREATE TABLE IF NOT EXISTS "wordpages_relatedword" ("id" SERIAL PRIMARY KEY, "related_word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED, "word_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_related_word_pair" UNIQUE ("word_id", "related_word_id"));
CREATE TABLE IF NOT EXISTS "chineseword_chineseword_favorites" ("id" SERIAL PRIMARY KEY, "chineseword_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_lesson" ("id" SERIAL PRIMARY KEY, "title" varchar(200) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "lesson_file" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "lessons_lesson_decks" ("id" SERIAL PRIMARY KEY, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "deck_id" bigint NOT NULL REFERENCES "users_deck" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_lesson_words" ("id" SERIAL PRIMARY KEY, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "chineseword_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_lexicalexercise" ("id" SERIAL PRIMARY KEY, "text" text NOT NULL, "audio_file" varchar(100) NOT NULL, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "parent_id" bigint NULL REFERENCES "lessons_lexicalexercise" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_readingtext" ("id" SERIAL PRIMARY KEY, "text" text NOT NULL, "audio_file" varchar(100) NOT NULL, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_lesson_supplementary_words" ("id" SERIAL PRIMARY KEY, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "chineseword_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_lesson_words_for_understanding" ("id" SERIAL PRIMARY KEY, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "chineseword_id" bigint NOT NULL REFERENCES "chineseword_chineseword" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lessons_homework" ("id" SERIAL PRIMARY KEY, "image" varchar(100) NOT NULL, "description" text NOT NULL, "lesson_id" bigint NOT NULL REFERENCES "lessons_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS schedule_homework (
    id SERIAL PRIMARY KEY,
    assigned_date DATE NOT NULL,
    due_date DATE NOT NULL,
    is_completed BOOLEAN NOT NULL,
    grade INTEGER NULL CHECK (grade >= 0), -- Убираем `unsigned` и заменяем на ограничение
    user_id INTEGER NOT NULL REFERENCES auth_user (id) DEFERRABLE INITIALLY DEFERRED,
    title VARCHAR(255) NOT NULL,
    lesson_id BIGINT NOT NULL REFERENCES schedule_lesson (id) DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS schedule_lesson (
    id SERIAL PRIMARY KEY,
    number INTEGER NOT NULL CHECK (number >= 0), -- Убираем `unsigned`, добавляем ограничение
    title VARCHAR(255) NOT NULL,
    description TEXT NULL,
    user_id INTEGER NOT NULL REFERENCES auth_user (id) DEFERRABLE INITIALLY DEFERRED,
    date TIMESTAMP NOT NULL -- Заменяем `datetime` на `TIMESTAMP`
);
